import {useSelector} from 'react-redux';
function Home() {
    const viewSource = useSelector(state => state.loginInfoReducer.backGroundImage);
    console.log(`viewSource:${useSelector(state => state.loginInfoReducer.backGroundImage)}`);
    const style={
        backGroundImage:`url(${viewSource})`
    }
  return (
    <div style={style}>Home <img src={viewSource}/></div>
  )
}

export default Home
